#!/bin/bash
CWD=$(pwd)
TIMESTAMP="$(date +%Y%m%d%H%M%S)"
RED='\e[0;31m'
GREEN='\e[0;32m'
YELLOW='\e[1;33m'
NC='\e[0m'

function echo_info ( ) {
    echo -n -e "${GREEN} ${1} ${NC}"
}

function echo_warn ( ) {
    echo -n -e "${YELLOW} ${1} ${NC}"
}

function echo_fail ( ) {
    echo -n -e "${RED} ${1} ${NC}"
}

echo_info "[ + ] Starting Auditd installer\n"
AUDITD="$(which auditctl)"
UNAME="$(uname -a | awk -F' ' '{print $1_$3_$4}')"
OS="$(cat /etc/os-release | grep '^NAME=\".*\"$' | cut -d '"' -f 2 | tr $'\n' ' ' | cut -d ' ' -f 1)"
echo_info "[ + ] Checking requirements are installed\n"
if [[ -z "${AUDITD}" ]];
then
    echo_fail "[ ! ] AUDITD is not installed!\n"
    case "${OS}" in
        Ubuntu)
            apt-get install auditd audispd-plugins -y
            ;;
        Debian)
            apt-get install auditd audispd-plugins -y
            ;;
        CentOS)
            yum install -y audit audit-libs audispd-plugins
            ;;
        *)
            echo_fail "[ ! ] OS not supported\n"
            exit 1
            ;;
    esac
fi
echo_info "[ + ] Auditd installed, starting and enabling the service\n"
systemctl start auditd
systemctl enable auditd

AUDITD_RULES=""
cp "/etc/audit/audit.rules" "${CWD}/audit_rules_bak.log" 
echo "${AUDITD_RULES}" | base64 -d > /etc/audit/audit.rules

echo_info "[ + ] Auditd rules configured\n"

LAUREL=""
echo_info "[ + ] Uncompressing the laurel binary and setting it up\n"
echo "${LAUREL}" | base64 -d | tar --lzma -xvf -
mv "${CWD}/laurel" /usr/local/sbin/laurel && chmod 0755 /usr/local/sbin/laurel
rm -rf "${CWD}/laurel"
chown root: /usr/local/sbin/laurel
useradd --system --home-dir /var/log/laurel --create-home _laurel
mkdir -p /etc/laurel/
echo "" | base64 -d > /etc/laurel/config.toml

LAUREL_CONFIG="$(echo """
active = yes
direction = out
type = always
format = string
path = /usr/local/sbin/laurel
args = --config /etc/laurel/config.toml
""")" 

case "${OS}" in
    Ubuntu)
        echo "${LARUEL_CONFIG}" > /etc/audisp/plugins.d/laurel.conf
        ;;
    Debian)
        echo "${LAUREL_CONFIG}" > /etc/audit/plugins.d/laurel.conf
        ;;
    CentOS)
        echo "${LAUREL_CONFIG}" > /etc/audit/plugins.d/laurel.conf
        ;;
    *)
        echo_fail "[ ! ] OS not supported\n"
        exit 1
        ;;
esac

pkill -HUP auditd

systemctl restart auditd
echo_warn "[ + ] Auditd setup complete"